import Navbar from "../components/Navbar";
import Hero from "../components/Hero";

function Contact() {
  return (
    <>
      <Navbar />
      <Hero
        cname="hero"
        heroimg="https://images.unsplash.com/photo-1583512603806-077998240c7a?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1169&q=80"
        title="Someone New In Life"
        text="Find Your First Companion Here."
        buttontext="Find Now"
        url="/"
        btnclass="show"
      />
    </>
  );
}

export default Contact;
